cy.intercept('GET', 'https://reqres.in/api/users?page=2', {
  statusCode: 200,
  body: {
    page: 2,
    per_page: 6,
    total: 12,
    total_pages: 2,
    data: [{
      id: 999,
      email: 'mocked@user.com',
      first_name: 'Mocked',
      last_name: 'User'
    }]
  }
}).as('mockUsers');
cy.visit('https://reqres.in/');
cy.request('GET', 'https://reqres.in/api/users?page=2').then(() => {
  cy.wait('@mockUsers').its('response.statusCode').should('eq', 200);
});
